import AlternatingCards from "./AlternatingCards";

const accomplishments = [
  {
	title: "Education",
	summary: "Virignia Tech, Blacksburg VA - Graduated Senior, Computer Science",
	date: "August 2019 - May 2023",
	items: [
	  "Cumulative GPA: 3.96",
	  "Graduated with a BS in Computer Science, Music Technology Minor",
	],
	image: '/images/code-icon.png',
  },
  {
	title: "Experience",
	summary: "Software Engineer, Richmond, VA - Costar Group",
	date: "July 2023 - Present",
	items: [
	  "Used Higcharts with React/TS and C#/SQL to deliver real-time and historical performance data",
	  "Gained full-stack and agile experience",
	  "Mentored an intern dev in summer 2024"
	],
	image: '/images/github-icon.png',
  },
  {
	summary: "Summer Internship, Jessup, MD - Vorbeck Materials Corp.",
	date: "May 2022 - August 2022",
	items: [
	  "Developed a web application using React and Openlayers API",
	  "Gained experience with React and UI design for real-time location data",
	],
	image: '/images/github-icon.png',
  },
  {
	title: "Projects",
	summary: "Custom Budgeting Dashboard",
	date: "May 2025 - Present",
	items: [
	  "Using highcharts with Next JS to analyze user csv trransaction data and create budgeting strategies",
	  'Delivered 10+ client projects',
	  'Improved SEO for blogs',
	],
	image: '/images/star-icon.png',
  },
  {
	summary: "Programming Project, Blacksburg VA - Tactical Strategy Video Game",
	date: "February 2018 - Current",
	items: [
	  "Developed a tactical strategy game level based off of Nintendo's Fire Emblem franchise",
	  "Used Java for original version, then used Python to create a random map generator add-on later"
	],
	image: '/images/trophy-icon.png',
  },
  {
	title: "Skills",
	items: [
	  "Java",
	  "JavaScript/TypeScript",
	  "Python",
	  "Swift",
	  "C#",
	  "SQL Server",
	  "Unreal Engine/C++"
	],
	image: '/images/trophy-icon.png',
  },
  {
	title: "Honors And Awards",
	items: [
		"Member of the Virginia Tech Honors College: January 2020 â€“ May 2023",
		"Published Research Paper To Creativity & Cognition Conference: April 2024"
	]
  }
];

function MainResume() {

	return (
		<div id="main-resume">

			<ResumeSection title={"Skills"} navId={"skills"}>
				<div id="programming-languages">
					<h3 className="subsection-header">Programming Languages</h3>
					<ul className="skill-list">
						<li>Java</li>
						<li>JavaScript</li>
						<li>Python</li>
						<li>Swift</li>
						<li>C</li>
						<li>Unreal Engine/C++</li>
					</ul>
				</div>
				<div id="computer-skills">
					<h3 className="subsection-header">Computer Skills</h3>
					<ul className="skill-list">
						<li>Github</li>
						<li>GUI Programming/HTML</li>
						<li>Object-Oriented Programming</li>
						<li>Regular Expressions</li>
					</ul>
				</div>
			</ResumeSection>

			<ResumeSection title={"Honors and Awards"} navId={"honors-and-awards"}>
				<ul className="honors-list">
					<li>Member of the Engineering Living Learning Community (Galileo) <span className="date-range">August 2019 â€“ May 2020</span></li>
					<li>AP Scholar with Distinction <span className="date-range">July 2019</span></li>
					<li>Member of the Virginia Tech Honors College <span className="date-range">January 2020 â€“ PRESENT</span></li>
					<li>Member of the BHS Chapter of the Math Honors <span className="date-range">Society October 2018 - May 2019</span></li>
				</ul>
			</ResumeSection>

			<AlternatingCards accomplishments={accomplishments}/>
		</div>
	);
}

const ResumeSection = ({navId, title, children}) => {
	return (
		<div
			id={navId}
			className="max-w-md mx-auto p-6 rounded-lg shadow-md"
			style={{ backgroundColor: 'rgb(199, 224, 189)' }}
		>
			<h2 className="text-2xl font-semibold text-gray-800 mb-4">{title}</h2>
			{children}
		</div>
	)
}

export default MainResume;
